items_title:
Album de photographies des oeuvres achetées par l'Etat intitulé : "Direction des Beaux-Arts. Ouvrages commandés ou acquis par le Service des Beaux-Arts. Salon de 1884. Photographié par G. Michelez".
Oeuvres exposées au salon annuel organisé par la Société des artistes français, au Palais des Champs-Elysées à Paris. 
Tirage photographique sur papier albuminé représentant : 
- "Départ pour la fête", tableau par Adolphe Ernest Gumery, No 1147, acquis par l'Etat ; 
- "L'Anse Saint-Martin (Manche, marée basse)", tableau par Prosper Galerne, No 991, mentionné ; 
- "Fuite de Gradlon", tableau par Evariste Vital Luminais, 1588, hors concours, acquis par l'Etat ; 
- "La Marne aux environs de la Ferté-sous-Jouarre", tableau par Henry Lefortier, No 1476, précisé dans le catalogue par "Seine-et-Marne", mentionné, acquis par l'Etat ; 
- "Le Christ au tombeau", tableau par Jean-Jacques Henner, No 1195, hors concours ; 
- "Marée basse", tableau par Eugène Boudin, No 316, hors concours.

Album de photographies des oeuvres achetées par l'Etat intitulé : "Direction des Beaux-Arts. Ouvrages commandés ou acquis par le Service des Beaux-Arts. Salon de 1882. Photographié par G. Michelez".
Oeuvres exposées au salon annuel organisé par la Société des artistes français, le 1er mai 1882, au Palais des Champs-Elysées à Paris.  
Tirage photographique sur papier albuminé représentant : 
- "Première communion en Picardie", tableau par Hugo Salmson, No 2392, exempté; 
- "La côte aux Vipères", tableau par Edmond Petitjean,  précisé dans le catalogue : "La Côte-aux-Vipères, près Villars (Lorraine)", No 2116; 
- "L'enfant prodigue", d'après l'Evangile selon Saint-Luc (XV, 20), tableau par Paul Emile Mangeant, No 1755, intitulé dans le catalogue "Retour de l'Enfant prodigue"; 
- "Novembre au Tréport", tableau par Gustave Edouard Le Sénéchal de Kerdréoret, No 1665, présenté hors concours; 
- "Eventail et poignard", d'après E. Goudeau, tableau par Alexandre Falguière, No 1006, présenté hors concours; 
- "Henri II au tombeau de Thomas Becket", d'après l'"Histoire de France" de Jules Michelet, tableau par Georges Bretegnier, No 383, intitulé dans le catalogue "Henri II d'Angleterre faisant amende honorable au tombeau de Thomas Becket".

Album de photographies des oeuvres achetées par l'Etat intitulé : "Direction des Beaux-Arts. Ouvrages commandés ou acquis par le Service des Beaux-Arts. Salon de 1879. Photographié par G. Michelez". 
Oeuvres exposées au salon annuel organisé par le Ministère de l'Instruction publique et des Beaux-Arts (Sous-secrétariat d'Etat des Beaux-Arts), en 1879, au Palais des Champs-Elysées à Paris.
Tirage photographique sur papier albuminé représentant : 
- "Piété de saint Louis pour les morts", d'après "Saint Louis et son siècle" par le vicomte Walsh, tableau par Edouard Bernard Debat Ponsan, No 2461, présenté hors concours, commandé ou acquis par le Ministère de l'Instruction publique et des Beaux-Arts, pour la cathédrale de La Rochelle ; 
- "Le Saint Viatique, en Bourgogne", tableau par Aimé Perret, No 2373, exempté, acquis par l'Etat ; 
- "La sieste", d'après M. J. Breton, tableau par Mme Marie Marthe Lanjalley, No 3948 ; 
- "Caron", d'après le livre I de l'"Enéïde" de Virgile, tableau par Jean Baptiste Brunet, No 451, récompensé par une mention honorable, acquis par l'Etat.

Album de photographies des oeuvres achetées par l'Etat intitulé : "Salon de 1864. Palais des Champs-Elysées. Tableaux commandés ou acquis par le Service des Beaux-Arts."
Oeuvres exposées au salon annuel organisé par la Surintendance du Ministère de la Maison de l'Empereur et des Beaux-Arts, en 1864, Palais des Champs-Elysées à Paris. 
Tirage photographique sur papier albuminé représentant : 
- "Embouchure de la Seine, à Honfleur", tableau par Alexandre Thiollet, No 1850; 
- "La Cartuja de Miraflores, près Bourgs (Espagne)", tableau par Hippolyte Sebron, No 1769, exempté (reçu sans examen), présenté hors concours, appartient à l'artiste; 
- "Combat d'avant-garde en Algérie (1846)", d'après "Souvenirs de la vie militaire en Afrique" par le comte P. de Castellane, tableau par Jules Vincent Alfred Rigo, No 1640, intitulé dans le catalogue "Combat d'avant-garde dans le Darha, soutenu par les spahis d'Oran contre le Chérif Bou-Maza. (Mars 1846)", présenté hors concours; 
- "Fleurs", tableau par Jules Leroy, No 1214; 
- "Femme fellah (Egypte)", tableau par Emile Lecomte, NO 1140, intitulé dans le catalogue "Femme fellah portant son enfant (Egypte)", exempté (reçu sans examen); 
- "Louis XIV enfant prenant une leçon d'équitation", tableau par de Frédéric de Courcy, No 456, précisé dans le catalogue par "M. de Beringhem, premier écuyer du roi, dirige les exercices, auxquels assistent la reine-mère et le duc d'Anjou, frère du roi.".

